    <h1>DeepLogic V9 - Dự đoán Tài Xỉu MD5 Go88</h1>
    <textarea id="md5Input" placeholder="Dán mã MD5 vào đây..."></textarea><br>
    <button onclick="predict()">Dự Đoán</button>
    <div class="result" id="predictionResult"></div>
    <div class="percent" id="confidence"></div>

    <script>
        function predict() {
            const md5 = document.getElementById("md5Input").value.trim().toLowerCase();
            if (md5.length !== 32 || !/^[0-9a-f]+$/.test(md5)) {
                document.getElementById("predictionResult").innerText = "❌ Mã MD5 không hợp lệ!";
                return;
            }

            const byte1 = parseInt(md5.slice(0, 2), 16);
            const byte2 = parseInt(md5.slice(2, 4), 16);
            const byte3 = parseInt(md5.slice(4, 6), 16);
            const total = byte1 + byte2 + byte3;
            const mod = total % 10;

            let prediction = "";
            let confidence = 50;

            if (mod <= 4) {
                prediction = "🎲 Kết quả: XỈU";
                confidence = 100 - (mod * 10); // 90% - 50%
            } else {
                prediction = "🎲 Kết quả: TÀI";
                confidence = 50 + ((mod - 5) * 10); // 60% - 90%
            }

            document.getElementById("predictionResult").innerText = prediction;
            document.getElementById("confidence").innerText = `Độ tin cậy: ${
                confidence
            }%`;

            // Auto clear input
            setTimeout(() => {
                document.getElementById("md5Input").value = "";
            }, 800);
        }
    </script>
